const apiKey = 'asdasdasd'; //Key obtenida al darnos de alta en GIPHY Developers

const peticion = fetch(`http://asdasdasdasd=${apiKey}`);

peticion
    .then( resp => resp.json())
    .then( ({ data }) =>{
        console.log(data.images.original.url)
    })
    .catch( console.warn );
